import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');

class Test extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: ''
		}
	}

	getImage = () => {
		const client = new AccountClient('http://10.43.1.110:8080');
		const request = new imageData();
		request.setFirstname(this.state.firstName);
		request.setLastname(this.state.lastName);
		request.setUsername(this.state.username);
		request.setEmail(this.state.emailAdress);
		request.setPassword(this.state.password);
		client.createUser(request, {}, (err, response) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				console.log(response.getMessage());
			}
		})
	}

	render() {
		return (
			<div>test page</div>
		)
	}
}

export default Test;
